import { APP_INITIALIZER, NgModule, Type } from '@angular/core';
import { Routes } from '@angular/router';

import { AppRoutingModule } from '@/app/app-routing.module';
import { CoreMainMenuTabRoutingModule } from '@features/mainmenu/mainmenu-tab-routing.module';
import { CoreSettingsHelper, CoreSettingsHelperProvider } from './services/settings-helper';
import { CoreSettingsDelegateService } from './services/settings-delegate';

export const CORE_SETTINGS_SERVICES: Type<unknown>[] = [
    CoreSettingsDelegateService,
    CoreSettingsHelperProvider,
];

const appRoutes: Routes = [
    {
        path: 'settings',
        loadChildren: () => import('./settings-lazy.module').then(m => m.CoreSettingsLazyModule),
    },
];

const mainMenuMoreRoutes: Routes = [
    {
        path: 'settings',
        loadChildren: () => import('./settings-lazy.module').then(m => m.CoreSettingsLazyModule),
    },
    {
        path: 'preferences',
        loadChildren: () => import('./settings-site-lazy.module').then(m => m.CoreettingsSiteLazyModule),
    },
];

@NgModule({
    imports: [
        AppRoutingModule.forChild(appRoutes),
        CoreMainMenuTabRoutingModule.forChild(mainMenuMoreRoutes),
    ],
    providers: [
        { provide: APP_INITIALIZER, multi: true, useValue: () => CoreSettingsHelper.initialize() },
    ],
})
export class CoreSettingsModule {}
